import Tile from "./Tile";
import './TileGrid.css';

const listOfAnimeTitles = ["Sup", "Hello", "How goes it", "Nothin' Much", "What's Up", "With You?"];

// should take in props so it can be customized for different uses
export default function TileGrid() {
  // do stuff to set up <Tile> compon.s grid of tiles :P

  let listOfTiles = [];

  listOfAnimeTitles.forEach((currTitle, index) => {
    listOfTiles.push(<Tile key={index} name={currTitle} />);
  });

  return (
    <div
      style={{
        display: 'flex',
        gap: '10px'
      }}
    >
      {listOfTiles}
    </div>
  )
}
